using System;
using System.Threading.Tasks;
using Dignite.Abp.Files.Fakes;
using Dignite.FileExplorer;
using Dignite.FileExplorer.TestObjects;
using Shouldly;
using SixLabors.ImageSharp;
using Xunit;

namespace Dignite.Abp.Files;

public class FileSystemBlobContainer_Tests : FileExplorerApplicationTestBase
{
    protected FakeFileManager FakeFileManager { get; }

    public FileSystemBlobContainer_Tests()
    {
        FakeFileManager = GetRequiredService<FakeFileManager>();
    }

    [Fact]
    public async Task Resize_Image_And_Save_Blob()
    {
        var blobName = "test_image_resize.jpeg";
        var base64String = "";
        var bytes = Convert.FromBase64String(base64String);
        var newFile = new FakeFile(Guid.NewGuid(), TestContainer.Name, blobName, blobName, "image/jpeg");
        var fakeFile = await FakeFileManager.CreateAsync(newFile, bytes);

        var stream = await FakeFileManager.GetStreamOrNullAsync(newFile.ContainerName, blobName);

        stream.ShouldNotBeNull();

        using (Image image = Image.Load(stream))
        {
            image.Width.Equals(200).ShouldBeTrue();
        }
    }
}